class ProjectAddPhaseRequestModel {  int? manageProjectId;  String? phaseName;  String? dateStart;  String? dateEnd;  int? staffResponsible;  String? status;  ProjectAddPhaseRequestModel(      {this.manageProjectId,        this.phaseName,        this.dateStart,        this.dateEnd,        this.staffResponsible,        this.status});  ProjectAddPhaseRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    phaseName = json['phase_name'];    dateStart = json['date_start'];    dateEnd = json['date_end'];    staffResponsible = json['staff_responsible'];    status = json['status'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['phase_name'] = this.phaseName;    data['date_start'] = this.dateStart;    data['date_end'] = this.dateEnd;    data['staff_responsible'] = this.staffResponsible;    data['status'] = this.status;    return data;  }}